import React, { useEffect, useState } from "react";

const App = () =>{

    const [num , setNum] = useState(0);
    
    useEffect(()=>{
        alert('im clicked');
    },[num])
    
    const incre = () =>{
        setNum(num+1);
    }

    return(
        <>
            <button onClick={incre}> click me {num}</button>
        </>
    )
}
export default App;
